import React from "react";
import "./Prodotti.css";
import Viaggi from "../Immagini/aereo.png";

const Prodotti = () => {
<>
<div className="d-flex justify-content-around">
      <div className="p-2 col-example text-left"><img src={Viaggi}/></div>
      <div className="p-2 col-example text-left">Flex item 2</div>
      <div className="p-2 col-example text-left">Flex item 3</div>
    </div>
</>
};
export default Prodotti;
